import React from 'react';
import "../../../css/mainLayout/footer/footer.css";

export default class Footer extends React.Component {
    render() {
        return (
            <div className="container-fluid footer">
                <div className="row">
                    <div className="col mr-auto">
                        <p>FXD</p>
                    </div>
                    <div className="col">
                    </div>
                </div>
            </div>
        )
    }
}
